  [],\n\t\"revision_timestamp\": \"2015-05-06T22:17:29.220830\",\n\t\"name\": \"new-lidar-laser-configuration-for-earth-science-measurements-project-2623e\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In this STTR Phase 1 program, Fibertek successfully
  developed and demonstrated a breadboard version of a pulsed fiber laser capable
  of high-spectral resolution lidar (HSRL) measurements. This was installed in the
  Lidar Lab. at the Univ. of Maryland, Baltimore county (UMBC). Lidar integration,
  calibration and validation was successfully performed, leading to the demonstration
  of direct backscatter measurements up to 10km atmospheric height, and HSRL measurement
  of the atmospheric boundary layer aerosol. Such measurements compared very well
  to the co-located lidar measurements conducted via the ELF and MPLNET lidar systems.
  rnrnFor the STTR Phase 2 program, Fibertek and UMBC propose to mature this technology
  platform, to develop, test, deliver and demonstrate a completed standalone HSRL
  lidar system capable continuos lidar measurement. The HSRL lidar transmitter sub-system
  can be also used for airborne HSRL missions, and the design is both power-scalable
  and compatible with a qualification roadmap, for future space-based HSRL missions.\",\n\t\"license_title\":
